import React, { Fragment } from 'react';
import { Route } from 'react-router-dom';
import './App.css';
import Landing from './components/layout/Landing';
import Navbar from './components/layout/Navbar';


const App = () => (
    <div className="App">
      <Fragment>
        <Navbar />
        <Route exact path='/' component={Landing} />
      </Fragment>
    </div>
)


export default App;
